import React from "react";
import ReactDom from 'react-dom';
import Joke from "./Jokes.js";

const Jokes = Joke.map(function(x)
{
  return (
    <h3>{x.punchline}</h3>
  )
})


const Element = <>
  {Jokes}

</>




const root = ReactDom.createRoot(document.getElementById('root'));
root.render(Element)
